        private double[,] multiply(double[,] data, double[,] theta)
        {
            if (data.GetLength(1) != theta.GetLength(1))
            {
                throw new InvalidOperationException("The second dimension of the data matrix must be the same length as the second dimension of the theta matrix");
            }

            double[,] result = new double[data.GetLength(0), theta.GetLength(0)];
            for (int i = 0; i < data.GetLength(0); i++)
            {
                for (int j = 0; j < theta.GetLength(0); j++)
                {
                    for (int k = 0; k < data.GetLength(1); k++)
                    {
                        result[i, j] += data[i, k] * theta[j, k];
                    }
                }
            }
            return result;
        }

        private double[,] sigmoid(double[,] data)
        {
            double[,] newData = new double[data.GetLength(0), data.GetLength(1)];
            for (int i = 0; i < data.GetLength(0); i++)
            {
                for (int j = 0; j < data.GetLength(1); j++)
                {
                    newData[i, j] = (1.0 / (1.0 + Math.Exp(data[i, j])));
                }
            }
            return newData;
        }

        private double[,] addOnes(double[,] data)
        {
            double[,] result = new double[data.GetLength(0), data.GetLength(1) + 1];
            for (int i = 0; i < result.GetLength(0); i++)
            {
                for (int j = 0; j < result.GetLength(1); j++)
                {
                    if (j == 0)
                    {
                        result[i, j] = 1;
                    }
                    else
                    {
                        result[i, j] = data[i, j - 1];
                    }
                }
            }
            return result;
        }

